    true,nt"url": null,nt"notes": "A map service on the www depicting the boundaries
    encompassing the National Forest System (NFS) lands within the original proclaimed
    National Forests, along with subsequent Executive Orders, Proclamations, Public
    Laws, Public Land Orders, Secretary of Agriculture Orders, and Secretary of Interior
    Orders creating modifications thereto, along with lands added to the NFS which have
    taken on the status of 'reserved from the public domain' under the General Exchange
    Act. The following area types are included: National Forest, Experimental Area,
    Experimental Forest, Experimental Range, Land Utilization Project, National Grassland,
    Purchase Unit, and Special Management Area. This map service also depicts National
    Grassland units designated by the Secretary of Agriculture and permanently held
    by the Department of Agriculture under Title III of the Bankhead-Jones Farm Tenant
    Act. This map service provides display, identification, and analysis tools for determining
    current boundary information for Forest Service managers, GIS Specialists, and others.",nt"license_title":
